            left: `${this.props.X}px`,
            top: `${this.props.Y}px`
        };
        return (<div id="settings-menu" style={css} className="context-menu">
            <div className="context-menu-item">
            <input type="file"  accept=".csv,.txt"/>
            </div>
            <div className="context-menu-item">
                {"Sync"}
            </div>
        </div>);
    }
}
